import React from "react";

const ProductInsert = ({ prod }) => {


let color 
    if(prod.price<20) color = "green"
    if(prod.price>20 && prod.price < 50) color = "yellow"
    if(prod.price>50) color = "red"




  let bgColor = {
    backgroundColor: color,
  };

  return (
    <div className="boxas" style={bgColor}>
        <img src={prod.image} alt="" />
      <h1>{prod.title}</h1>
      <h2>Price:{prod.price}</h2>
    </div>
  );
};

export default ProductInsert;
